import Link from "next/link";

const Navbar = () => (
  <ul>
    <li className="link">
      <Link href="/">Home</Link>
    </li>
    <li className="link">
      <Link href="/about">About</Link>
    </li>
    <li className="link">
      <a href="/Services">Services</a>
    </li>
  </ul>
);

export default Navbar;
